INSERT INTO `tp_art` VALUES ('10', '1111111', '&lt;p class=&quot;text&quot; style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); text-indent: 2em; font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;蚯蚓矿网和中国权威第三方签证中心公司达成战略合作关系，携手致力于办理中国人出国签证，签证目的地覆盖全球所有热门国家。我们专注于提供一站式的签证服务体验，为您私人定制最佳的签证解决方案，确保您如期轻松的获得签证，远离拒签。&lt;/p&gt;&lt;p class=&quot;text&quot; style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); text-indent: 2em; font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;公司目前提供非洲、中东、南美、东南亚、澳洲等矿业相关国家的签证咨询及办理服务，包含旅游签证、商务签证、探亲访友签证、留学签证、工作签证、过境签证等，出签成功率接近100%，并对全球各主要国家开设加急签证服务，解决您的燃眉之急。为了确保客户拥有良好的一站式出国服务体验，我们还为您提供出国保险、酒店机票预定、行程安排、翻译、地接等优质服务。&lt;/p&gt;&lt;p class=&quot;text&quot; style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); text-indent: 2em; font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;公司在长期的发展过程中，切实贯彻“品质专业、作风严谨、贴心服务、诚信为本”的公司文化，拥有一支高素质的专业签证顾问团队，时刻关注各国最新的签证政策及动向，并与多国领事馆保持良好的合作关系。公司率先实施现代化的管理模式，独家研发的MQVISA 5.0签证业务管理系统，保证客户资料的安全。&lt;/p&gt;&lt;p class=&quot;text&quot; style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); text-indent: 2em; font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;公司面向全国客户，已经为数十万客户与数百家企业提供了专业化的签证定制服务，得到了广大新老客户及业内企业的高度认可。我们将不断努力、不断完善、不断创新，为所有客户提供最专业签证服务体验。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '0', '1', '0', '0', '462', '1509449645', '3', '', '', '', '', null, null, '', null);
