INSERT INTO `tp_art` VALUES ('18', '公司介绍', '&lt;h4 class=&quot;company_name&quot; style=&quot;margin: 0px 0px 30px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;蚯蚓矿业网络服务有限公司&lt;/h4&gt;&lt;p class=&quot;company_pro&quot; style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); text-indent: 2em; font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;蚯蚓矿业网络服务有限公司，是一家致力于矿业交易及矿业服务的互联网公司。公司基于矿业，利用互联网工具，结合传统的外贸交易形式，打通矿产交易买家和卖家的信息障碍，让矿产交易效率更高，成本更低，这也是我们一贯奉行的使命。&lt;/p&gt;&lt;p class=&quot;company_pro&quot; style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); text-indent: 2em; font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;蚯蚓矿网聚焦矿业，一心一意为矿业相关卖家、品牌及其他企业提供信息支持以及平台服务，借助互联网的力量实现用户和客户的双向互动，并最终实现交易。我们的业务包括自营进口金属、非金属矿石，现货、期货的交易服务及矿业产品的供应链服务；&lt;/p&gt;&lt;p class=&quot;company_pro&quot; style=&quot;margin-top: 0px; margin-bottom: 20px; padding: 0px; font-size: 14px; color: rgb(51, 51, 51); text-indent: 2em; font-family: &amp;quot;Microsoft YaHei&amp;quot;, SimSun, Verdana, Arial, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;蚯蚓矿网是一个基于矿业的互联网交易平台，我们的愿景是成为全球领先的矿业互联网综合服务企业。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '0', '1', '0', '0', '317', '1509451998', '7', '', '', '', '', null, null, '', null);
